import * as React from 'react';
import { CssBaseline, Button, Container, Box, ButtonGroup,Grid }  from '@mui/material';
import TwitterIcon from '@mui/icons-material/Twitter';
import FormatQuoteIcon from '@mui/icons-material/FormatQuote';
import axios from 'axios';
import './App.css';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';


function App() {
  return (
      <>
      <React.Fragment>
       <CssBaseline/>
       <Container maxWidth='100vw'>
       <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }}>
        <Box id='quote-box' sx={{bgcolor: 'white',height: '50vh', width: '50vw',position: 'absolute', left: '25%',top: '25%',borderRadius: 4 }}>
          <Box sx={{height: '10vh',width:'10vw',position:'absolute',left:'15%',top:'13%',color:'#cfe8fc'}}><FormatQuoteIcon sx={{transform:'rotateY(180deg) scale(2.5)'}}/></Box>
          <Box id='text' sx={{border: '1px solid black',bgcolor:'white',color:'#cfe8fc',position:'absolute',width:'30vw',height:'25vh',left:'20%',top:'15%'}}>Text</Box>
          <ButtonGroup variant='outlined' sx={{position:'absolute', left: '450px', top: '325px'}}>
            <Button id='new-quote'>New Quote</Button>
            <Button id='tweet-quote'><a href='https://www.google.com' id='tweet-quote' target='_blank' style={{color:'#cfe8fc'}}><TwitterIcon /></a></Button>
          </ButtonGroup>
        </Box>
       </Box>
       </Container>
      </React.Fragment>
      </>
  )
}

export default App;
